import React from 'react';
import './mainPage.css';

export class MainPage extends React.Component {
    
    render() {
        return(
            <div>
                <div>
                    <ul class="navbar">
                        <li class="one">About</li>
                        <li class="two">History</li>
                        <li class="three">Stats</li>
                        <li class="four">Home</li>
                        <li class="logo" style="float:left"><img src="./BiLLy Logo.png" width="160rem" height="auto"/></li>
                    </ul>
                </div>


            </div>
        )
    }
}
